import React, { Component } from "react";
import classes from './SignUp.css';
import { Button, Form,Input } from 'element-react';
import { i18n } from 'element-react'
import locale from 'element-react/src/locale/lang/en'
class SignUp extends Component {
    state = {
        form: {
            email: '',
            password: '',
        },
        rules: {
            email: [
                { required: true, message: "teste", trigger: 'change' }
            ],
            password: [
                { required: true, message: "teste", trigger: 'change' },
            ],
        }
    };

    componentDidMount = () => {

    }

    render() {
        return (
            <div class="header">
                <div class="text-box">




                    <h1 class="heading-primary">
                        Cadastro
                    </h1>

                    <Form htmlFor="email" className={classes.allForm} ref="form" model={this.state.form} rules={this.state.rules}>
                        <Form.Item prop="email" labelWidth="0px">
                            <Input placeholder={"strings[this.props.language].first_name"} type="text"/>
                        </Form.Item>
                    </Form>


                    <Button loading={true}>Cadastrar</Button>


                </div>
            </div>
        );
    }
}

export default SignUp;
